import React, { Component } from 'react';
import {
    Row, Col
} from 'reactstrap';

class Header extends Component{

    constructor(props) {
		super(props);
		this.toggle = this.toggle.bind(this);
		this.state = {
            isOpen:true,
		  dropdownOpen: false
		};
	}

	toggle() {
		this.setState({
		  dropdownOpen: !this.state.dropdownOpen,
		});
	}

	render(){
        const pos = {size: 10, offset: 1}
		return(
			<Row>
                <Col xs={pos} sm={pos} md={pos} className="bg-primary" >
                    hola
                </Col>
            </Row>
		)
	}
}

export default Header;
